import { coins } from '../../api/coins';
import { currency } from '../../api/currency';
import { exchange } from '../../api/exchange';
import MultiSelect from '../MultiSelect/MultiSelect';
import './Main.css';

function App() {
  return (
    <div className="Main">
      UI
      <div class="row">
        <MultiSelect options={coins}></MultiSelect>
        <MultiSelect options={exchange}></MultiSelect>
        <MultiSelect options={currency}></MultiSelect>
      </div>
    </div>
  );
}

export default App;
